import React from "react";

import data from './data.json';


const MainTable =()=>{

    const dataImport = data[0]; 

    function renderHeaders(){
        let headers = [];

        Object.keys(dataImport).map((x,i) => {
            headers.push(<td key={i.name}>{x}</td>); 
        });

        console.log(Object.keys(dataImport));

        return headers; 

    }

    function renderValues(){
        let values = [];

        let res = Object.values(dataImport);

        console.log(res);
        res.map((x, i) => {
            Object.values(res[i]).map(x => {
                values.push(<td >{x}</td>);
                return values;
            });
            return values;
        });

        return values;

    }

    return(
    <React.Fragment>

        <p>Table</p>
        <table>
            <thead>
                <tr>{renderHeaders()}</tr>
            </thead>
            <tbody>
                <tr>{renderValues()}</tr>
            </tbody>                  
        </table>
    </React.Fragment> 
    )
}

export default MainTable;
